import React, {Component} from "react";
import ReactDOM from 'react-dom'

import { Link } from "react-router-dom";
import CarUIMoveable from '../components/CarUIMoveable'; //'./' is current folder

// var value = "target"
//
// var element = <CarUIMoveable id = "carUIMoveable" moveableTarget={value} />;
//
// function changeClass(){
//   if (value == "target")
//     value = "temp"
//   else
//     value = "target"
//   element.resetState;
// }


export default class carUIPage extends Component {
  constructor(props){
    super(props);
    this.changeChild = React.createRef();
  }

  // changeClass(){
  //   this.reloadChild();
  //   console.log("hi")
  //   if (this.value == "target")
  //       this.value = "temp"
  //     else
  //       this.value = "target"
  // }



  render() {
    return (
        <div>
            <div id="toot"></div>
            <CarUIMoveable id = "carUIMoveable" ref = {this.changeChild} moveableTarget={this.value} />


            <img onClick = {this.changeChild.current.updateTarget()} id = "toChange" class="target" src="https://upload.wikimedia.org/wikipedia/commons/thumb/2/21/Cutest_Koala.jpg/1117px-Cutest_Koala.jpg"/>
            <h1>Car UI Page</h1>
            <Link to="/upload_img">Upload Image</Link>
            <Link to="/edit_img">Edit Existing Image</Link>
            <h2>Edit Existing Image</h2>
            <ul>
                <li>Size, position, rotation</li>
                <li>Delete</li>
                <li>Replace</li>
            </ul>
            <Link to="/">Back to Profile Page</Link>
        </div>
    );
};
}
